class App extends React.Component  {

 render(){


// console.log(localStorage === undefined)
       switch(this.state.pages){
         case "login":
           return <Pages.Login redirect={this.redirect}/>
         case 'home':
           return <Pages.Home/>
       }

 }
}

export default App;
